class Solution:
    def lengthOfLongestSubstring(self, s: str) -> int:
        sub_len = 0
        pre_len = 0
        left = 0
        lookup = []

        for i in range(len(s)):
            sub_len += 1
            while s[i] in lookup:
                lookup.remove(s[left])
                sub_len -= 1
                left += 1
            if sub_len > pre_len: pre_len = sub_len
            lookup.append(s[i])

        return pre_len

    def lengthOfLongestSubstring_1(self, s: str) -> int:
        k = -1
        res = 0
        lookup = {}

        for i, c in enumerate(s):
            if c in lookup and lookup[c] > k:
                k = lookup[c]
                lookup[c] = i
            else:
                lookup[c] = i
                res = max(res, i-k)

        return res

